body:
**Describe the bug**
When adding and removing initializer tensors to and from a Graph (Graph::AddInitializedTensor()/Graph::RemoveInitializedTensor()), it is possible to get to a state where the GraphProto returned by Graph::ToGraphProto() does not contain the expected number of initializers. Moreover, the results of the const and non-const versions of Graph::ToGraphProto() can be inconsistent.

**To Reproduce**
Here is a test that shows the issue, observed at Git commit: 041a1cab54493d3d32e6a6a8b4981add8c1419ed

```cpp
#include "core/graph/graph.h"
#include "core/graph/model.h"

#include "gtest/gtest.h"

namespace onnxruntime {
namespace test {
TEST(GraphBugTest, InitializerInconsistency) {
  Model m{"test_model"};
  Graph& graph = m.MainGraph();

  ONNX_NAMESPACE::TensorProto init{};
  init.set_name("name");
  init.set_data_type(ONNX_NAMESPACE::TensorProto_DataType_INT32);
  init.add_dims(1);
  init.add_int32_data(1);

  graph.AddInitializedTensor(init);
  graph.RemoveInitializedTensor(init.name());
  graph.AddInitializedTensor(init);

  ASSERT_EQ(graph.GetAllInitializedTensors().size(), 1);

  ONNX_NAMESPACE::GraphProto graph_proto_from_const_graph =
      static_cast<const Graph&>(graph).ToGraphProto();
  ONNX_NAMESPACE::GraphProto graph_proto_from_graph = graph.ToGraphProto();

  ASSERT_EQ(graph_proto_from_const_graph.initializer_size(), 1);
  ASSERT_EQ(graph_proto_from_graph.initializer_size(), 1); // this assertion fails
}
}  // namespace test
}  // namespace onnxruntime
```

**Expected behavior**
Graph::AddInitializedTensor() should add an initializer, and Graph::RemoveInitializedTensor() should remove the named initializer. The initializers returned by Graph::GetAllInitializedTensors() should be the same as the ones in the result of Graph::ToGraphProto(). The const and non-const versions of Graph::ToGraphProto() should return the same result.
